import {FaInstagram} from 'react-icons/fa'

function Footer() {

    function handleClick() {
        window.location.href = 'https://www.instagram.com/moonsoulmusic/'
    }



    return (
        <div>
            <FaInstagram onClick={handleClick} />
        </div>
    )
}

export default Footer;
